import React, { useState } from 'react';
import { TabContent, TabPane, Nav, NavItem, NavLink } from 'reactstrap';
import { MessageSquare, Play, Share } from 'react-feather';

// import useTopChart from '../hooks/useTopChart';

function Home() {
  const [active, setActive] = useState('1');
//   const topChart = useTopChart({});

  const handleTopChart = () => {
    setActive({ active: 1 });
  };
  const handleTopArtist = () => {
    setActive({ active: 2 });
    alert('munculs');
  };
  return (
    <div className="min-h-screen bg-csb-black">
      <div className="bg-csb-red">
        <Nav tabs fill>
          <NavItem>
            <NavLink
              active={active === '1'}
              onClick={() => {
                setActive('1');
              }}
            >
              Top Chart
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              active={active === '2'}
              onClick={() => {
                setActive('2');
              }}
            >
              Top Artist
            </NavLink>
          </NavItem>
        </Nav>
        <TabContent activeTab={active}>
          <TabPane tabId="1">
            <div>
              <h3>Music delivered to you</h3>
              <div className="flex">
                <button className="flex">
                  <span>
                    <Play />
                  </span>
                  Play All
                </button>
                <p className='flex'>
                  <span>
                    <Share />
                  </span>{' '}
                  Share
                </p>
                <p className='flex'>
                  <span>
                    <MessageSquare />
                  </span>
                  Comment
                </p>
              </div>
            </div>
            <p>test</p>
          </TabPane>
          <TabPane tabId="2">
            <p className="text-csb-white">Top Artist</p>
          </TabPane>
        </TabContent>
      </div>
    </div>
  );
}

export default Home;
